import React, { useState } from 'react';
import { format } from 'date-fns';
import { 
  Eye, 
  Edit, 
  Trash2, 
  Calendar, 
  AlertTriangle, 
  Baby, 
  Heart, 
  Droplets, 
  Moon,
  User,
  FileText,
  MoreVertical
} from 'lucide-react';
import { obstetricsService } from '../../services/obstetricsService';
import toast from 'react-hot-toast';
import Modal from '../common/Modal';
import EditObstetricsCarePlanModal from './EditObstetricsCarePlanModal';

const AdminObstetricsSection = ({ carePlans, onRefresh, isAdminView = false }) => {
  const [selectedPlan, setSelectedPlan] = useState(null);
  const [showDetailModal, setShowDetailModal] = useState(false);
  const [showEditModal, setShowEditModal] = useState(false);
  const [showDeleteConfirm, setShowDeleteConfirm] = useState(false);
  const [loading, setLoading] = useState(false);

  const handleViewDetails = (plan) => {
    setSelectedPlan(plan);
    setShowDetailModal(true);
  };

  const handleEdit = (plan) => {
    setSelectedPlan(plan);
    setShowEditModal(true);
  };

  const handleDelete = (plan) => {
    setSelectedPlan(plan);
    setShowDeleteConfirm(true);
  };

  const confirmDelete = async () => {
    if (!selectedPlan) return;

    setLoading(true);
    try {
      const result = await obstetricsService.deleteCarePlan(selectedPlan._id);
      if (result.success) {
        toast.success('Obstetrics care plan deleted successfully');
        onRefresh();
      } else {
        toast.error(result.message || 'Failed to delete care plan');
      }
    } catch (error) {
      toast.error('Error deleting care plan');
    } finally {
      setLoading(false);
      setShowDeleteConfirm(false);
      setSelectedPlan(null);
    }
  };

  const handleEditSuccess = () => {
    setShowEditModal(false);
    setSelectedPlan(null);
    onRefresh();
    toast.success('Obstetrics care plan updated successfully');
  };

  const getPriorityColor = (priority) => {
    switch (priority) {
      case 'urgent': return 'priority-urgent';
      case 'high': return 'priority-high';
      case 'medium': return 'priority-medium';
      case 'low': return 'priority-low';
      default: return 'priority-medium';
    }
  };

  const getCareTypeColor = (type) => {
    switch (type) {
      case 'prenatal': return 'badge-info';
      case 'postnatal': return 'badge-success';
      case 'delivery-prep': return 'badge-warning';
      default: return 'badge-info';
    }
  };

  const getSeverityColor = (severity) => {
    switch (severity) {
      case 'none': return 'text-green-600';
      case 'mild': return 'text-yellow-600';
      case 'moderate': return 'text-orange-600';
      case 'severe': return 'text-red-600';
      default: return 'text-gray-600';
    }
  };

  if (carePlans.length === 0) {
    return (
      <div className="empty-state">
        <Baby className="empty-state-icon" />
        <h3 className="empty-state-title">No Obstetrics Care Plans</h3>
        <p className="empty-state-description">
          No obstetrics care plans match your current filters.
        </p>
      </div>
    );
  }

  return (
    <>
      {/* Card View */}
      <div className="care-plans-grid">
        {carePlans.map((plan) => (
          <div key={plan._id} className="care-plan-card admin-card">
            <div className={`priority-indicator ${getPriorityColor(plan.priority)}`}></div>

            <div className="card-header">
              <div>
                <h3 className="card-title">
                  {plan.careType === 'prenatal' && 'Prenatal Care'}
                  {plan.careType === 'postnatal' && 'Postnatal Care'}
                  {plan.careType === 'delivery-prep' && 'Delivery Preparation'}
                </h3>
                <p className="card-subtitle">
                  <User size={14} />
                  {plan.patientName} â€¢ Dr. {plan.doctorName}
                </p>
              </div>
              <div className="card-header-actions">
                <span className={`badge ${getCareTypeColor(plan.careType)}`}>
                  {plan.careType}
                </span>
                <div className="dropdown">
                  <button className="dropdown-trigger">
                    <MoreVertical size={16} />
                  </button>
                  <div className="dropdown-menu">
                    <button onClick={() => handleViewDetails(plan)}>
                      <Eye size={14} />
                      View Details
                    </button>
                    <button onClick={() => handleEdit(plan)}>
                      <Edit size={14} />
                      Edit Plan
                    </button>
                    <button onClick={() => handleDelete(plan)} className="danger">
                      <Trash2 size={14} />
                      Delete Plan
                    </button>
                  </div>
                </div>
              </div>
            </div>

            <div className="card-content">
              {/* Gestational Week */}
              {plan.gestationalWeek && (
                <div className="care-detail">
                  <Calendar size={16} />
                  <span>Week {plan.gestationalWeek} of pregnancy</span>
                </div>
              )}

              {/* Trimester Symptoms */}
              {plan.careDetails?.trimesterSymptoms && (
                <div className="symptoms-summary">
                  {plan.careDetails.trimesterSymptoms.nausea !== 'none' && (
                    <div className="care-detail">
                      <Droplets size={16} />
                      <span className={getSeverityColor(plan.careDetails.trimesterSymptoms.nausea)}>
                        Nausea: {plan.careDetails.trimesterSymptoms.nausea}
                      </span>
                    </div>
                  )}
                  {plan.careDetails.trimesterSymptoms.mood !== 'stable' && (
                    <div className="care-detail">
                      <Heart size={16} />
                      <span>Mood: {plan.careDetails.trimesterSymptoms.mood}</span>
                    </div>
                  )}
                </div>
              )}

              {/* Baby Movement */}
              {plan.careDetails?.babyMovement?.frequency && (
                <div className="care-detail">
                  <Baby size={16} />
                  <span>Baby movement: {plan.careDetails.babyMovement.frequency}</span>
                </div>
              )}

              {/* Sleep & Nutrition */}
              {plan.careDetails?.sleepNutrition && (
                <div className="care-detail">
                  <Moon size={16} />
                  <span>
                    Sleep: {plan.careDetails.sleepNutrition.sleepHours}h 
                    ({plan.careDetails.sleepNutrition.sleepQuality})
                  </span>
                </div>
              )}

              {/* Instructions Preview */}
              <div className="instructions-preview">
                <FileText size={14} />
                <span>{plan.instructions.substring(0, 80)}...</span>
              </div>
            </div>

            <div className="card-meta">
              <span>
                <Calendar size={12} />
                {format(new Date(plan.createdAt), 'MMM dd, yyyy')}
              </span>
              <span className={`badge badge-${plan.status === 'active' ? 'success' : 'info'}`}>
                {plan.status}
              </span>
            </div>

            {isAdminView && (
              <div className="card-actions">
                <button
                  onClick={() => handleViewDetails(plan)}
                  className="btn btn-outline btn-sm"
                >
                  <Eye size={14} />
                  View
                </button>
                <button
                  onClick={() => handleEdit(plan)}
                  className="btn btn-primary btn-sm"
                >
                  <Edit size={14} />
                  Edit
                </button>
                <button
                  onClick={() => handleDelete(plan)}
                  className="btn btn-danger btn-sm"
                >
                  <Trash2 size={14} />
                  Delete
                </button>
              </div>
            )}
          </div>
        ))}
      </div>

      {/* Detailed Table View */}
      <div className="table-container">
        <table className="table">
          <thead>
            <tr>
              <th>Patient</th>
              <th>Care Type</th>
              <th>Gestational Week</th>
              <th>Status</th>
              <th>Priority</th>
              <th>Created</th>
              {isAdminView && <th>Actions</th>}
            </tr>
          </thead>
          <tbody>
            {carePlans.map((plan) => (
              <tr key={plan._id}>
                <td>
                  <div>
                    <div className="font-medium">{plan.patientName}</div>
                    <div className="text-sm text-gray-500">ID: {plan.patientId}</div>
                    <div className="text-sm text-gray-500">Dr. {plan.doctorName}</div>
                  </div>
                </td>
                <td>
                  <span className={`badge ${getCareTypeColor(plan.careType)}`}>
                    {plan.careType}
                  </span>
                </td>
                <td>
                  {plan.gestationalWeek ? `Week ${plan.gestationalWeek}` : 'N/A'}
                </td>
                <td>
                  <span className={`badge badge-${plan.status === 'active' ? 'success' : 'info'}`}>
                    {plan.status}
                  </span>
                </td>
                <td>
                  <span className={`badge badge-${plan.priority === 'urgent' ? 'error' : plan.priority === 'high' ? 'error' : plan.priority === 'medium' ? 'warning' : 'success'}`}>
                    {plan.priority}
                  </span>
                </td>
                <td>{format(new Date(plan.createdAt), 'MMM dd, yyyy')}</td>
                {isAdminView && (
                  <td>
                    <div className="table-actions">
                      <button
                        onClick={() => handleViewDetails(plan)}
                        className="btn btn-outline btn-sm"
                        title="View Details"
                      >
                        <Eye size={14} />
                      </button>
                      <button
                        onClick={() => handleEdit(plan)}
                        className="btn btn-primary btn-sm"
                        title="Edit Plan"
                      >
                        <Edit size={14} />
                      </button>
                      <button
                        onClick={() => handleDelete(plan)}
                        className="btn btn-danger btn-sm"
                        title="Delete Plan"
                      >
                        <Trash2 size={14} />
                      </button>
                    </div>
                  </td>
                )}
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      {/* Detail Modal */}
      <Modal
        isOpen={showDetailModal}
        onClose={() => setShowDetailModal(false)}
        title="Obstetrics Care Plan Details"
        size="large"
      >
        {selectedPlan && (
          <div className="care-plan-details">
            <div className="detail-section">
              <h3>Basic Information</h3>
              <div className="detail-grid">
                <div className="detail-item">
                  <label>Patient ID:</label>
                  <span>{selectedPlan.patientId}</span>
                </div>
                <div className="detail-item">
                  <label>Patient Name:</label>
                  <span>{selectedPlan.patientName}</span>
                </div>
                <div className="detail-item">
                  <label>Doctor ID:</label>
                  <span>{selectedPlan.doctorId}</span>
                </div>
                <div className="detail-item">
                  <label>Doctor:</label>
                  <span>Dr. {selectedPlan.doctorName}</span>
                </div>
                <div className="detail-item">
                  <label>Care Type:</label>
                  <span className={`badge ${getCareTypeColor(selectedPlan.careType)}`}>
                    {selectedPlan.careType}
                  </span>
                </div>
                {selectedPlan.gestationalWeek && (
                  <div className="detail-item">
                    <label>Gestational Week:</label>
                    <span>Week {selectedPlan.gestationalWeek}</span>
                  </div>
                )}
              </div>
            </div>

            {/* Admin Actions in Modal */}
            <div className="modal-admin-actions">
              <button
                onClick={() => {
                  setShowDetailModal(false);
                  handleEdit(selectedPlan);
                }}
                className="btn btn-primary"
              >
                <Edit size={16} />
                Edit Care Plan
              </button>
              <button
                onClick={() => {
                  setShowDetailModal(false);
                  handleDelete(selectedPlan);
                }}
                className="btn btn-danger"
              >
                <Trash2 size={16} />
                Delete Care Plan
              </button>
            </div>
          </div>
        )}
      </Modal>

      {/* Edit Modal */}
      <EditObstetricsCarePlanModal
        isOpen={showEditModal}
        onClose={() => setShowEditModal(false)}
        onSuccess={handleEditSuccess}
        carePlan={selectedPlan}
      />

      {/* Delete Confirmation Modal */}
      <Modal
        isOpen={showDeleteConfirm}
        onClose={() => setShowDeleteConfirm(false)}
        title="Confirm Deletion"
        size="small"
      >
        <div className="delete-confirmation">
          <div className="delete-icon">
            <AlertTriangle size={48} className="text-red-500" />
          </div>
          <h3>Delete Care Plan?</h3>
          <p>
            Are you sure you want to delete the care plan for <strong>{selectedPlan?.patientName}</strong>?
            This action cannot be undone.
          </p>
          <div className="delete-actions">
            <button
              onClick={() => setShowDeleteConfirm(false)}
              className="btn btn-outline"
              disabled={loading}
            >
              Cancel
            </button>
            <button
              onClick={confirmDelete}
              className="btn btn-danger"
              disabled={loading}
            >
              {loading ? 'Deleting...' : 'Delete Care Plan'}
            </button>
          </div>
        </div>
      </Modal>
    </>
  );
};

export default AdminObstetricsSection;
